s/junegunn/repos\",\"events_url\":\"https://api.github.com/users/junegunn/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/junegunn/received_events\",\"type\":\"User\",\"site_admin\":false},\"content_type\":\"application/octet-stream\",\"state\":\"uploaded\",\"size\":1444356,\"download_count\":38,\"created_at\":\"2017-01-29T17:00:57Z\",\"updated_at\":\"2017-01-29T17:01:03Z\",\"browser_download_url\":\"https://github.com/junegunn/fzf-bin/releases/download/0.16.3/fzf-0.16.3-windows_amd64.zip\"}],\"tarball_url\":\"https://api.github.com/repos/junegunn/fzf-bin/tarball/0.16.3\",\"zipball_url\":\"https://api.github.com/repos/junegunn/fzf-bin/zipball/0.16.3\",\"body\":\"-
        Fixed a bug where fzf incorrectly display the lines when straddling tab\\n
        \ characters are trimmed\\n- Placeholder expression used in `--preview` and
        `execute` action can\\n  optionally take `+` flag to be used with multiple
        selections\\n  - e.g. `git log --oneline | fzf --multi --preview 'git show
        {+1}'`\\n- Added `execute-silent` action for executing a command silently
        without\\n  switching to the alternate screen. This is useful when the process
